Семейный аккаунт: 

- Возможность присоединить к своему аккаунту семью; 

- Управление визитами и просмотр истории посещений детей, родителей супругов; 

- Хранение произвольных фотографий для быстрой идентификации личности в медцентре. 

 

Поиск лекарств в аптеках Беларуси: 

- Поиск по цене и расстоянию; 

- Цветовое обозначение ценового диапазона; 

- Информация о препаратах: наименование, производитель, дозировка, форма выпуска и норма отпуска, в т.ч. по рецепту или без. 

 
 

Для сотрудников EPAM Systems: 

- Возможность подключения к корпоративной программе компании EPAM Systems в приложении Aibolit для сотрудников и родственников сотрудников; 

- Специальный индикатор (точка или бейдж EPAM) на услугах, врачах и медцентрах покажет, что входит в вашу медицинскую программу.

